import React from "react";
import {Container, Typography, Box, Grid, Paper} from "@material-ui/core";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import SvgIcon from "@material-ui/core/SvgIcon";
import Button from "@material-ui/core/Button";
import FilledInput from '@material-ui/core/FilledInput';
import FormControl from '@material-ui/core/FormControl';
import FormHelperText from '@material-ui/core/FormHelperText';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import OutlinedInput from '@material-ui/core/OutlinedInput';

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        background: '#5d62b5',
        marginTop: theme.spacing(10),
        marginBottom: theme.spacing(10),
        borderRadius: 30,
    },
    typographyHeader: {
        color: '#fff',
        textAlign: 'center',
        paddingTop: theme.spacing(7),
    },
}));

function Appointment() {
    const classes = useStyles();

    return (
        <div className="AppointmentBackgroundImage">
            <div className={classes.root}>
                <Container maxWidth="lg">
                    <Grid
                        container
                        justify="flex-start"
                        alignItems="flex-start"
                        direction="row"
                    >
                        <Grid item sm={6}>
                            <Paper elevation={7} className={classes.paper}>
                                <Typography component="div" className={classes.typographyHeader}>
                                    <Box fontSize="h4.fontSize" fontWeight="fontWeightBold">
                                        Make an appointment
                                    </Box>
                                </Typography>
                                <form>
                                    <FormControl>
                                        <InputLabel htmlFor="component-helper">Name</InputLabel>
                                        <Input
                                            id="component-helper"
                                            value={name}
                                            onChange={handleChange}
                                            aria-describedby="component-helper-text"
                                        />
                                        <FormHelperText id="component-helper-text">Some important helper text</FormHelperText>
                                    </FormControl>
                                    <FormControl disabled>
                                        <InputLabel htmlFor="component-disabled">Name</InputLabel>
                                        <Input id="component-disabled" value={name} onChange={handleChange} />
                                        <FormHelperText>Disabled</FormHelperText>
                                    </FormControl>
                                    <FormControl error>
                                        <InputLabel htmlFor="component-error">Name</InputLabel>
                                        <Input
                                            id="component-error"
                                            value={name}
                                            onChange={handleChange}
                                            aria-describedby="component-error-text"
                                        />
                                        <FormHelperText id="component-error-text">Error</FormHelperText>
                                    </FormControl>
                                    <FormControl variant="outlined">
                                        <InputLabel htmlFor="component-outlined">Name</InputLabel>
                                        <OutlinedInput id="component-outlined" value={name} onChange={handleChange} label="Name" />
                                    </FormControl>
                                    <FormControl variant="filled">
                                        <InputLabel htmlFor="component-filled">Name</InputLabel>
                                        <FilledInput id="component-filled" value={name} onChange={handleChange} />
                                    </FormControl>
                                </form>
                            </Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
        </div>
    )
}

export default Appointment;
